import React from "react";
import "./post.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Card,
  CardBody,
  CardImg,
  CardText,
  CardTitle,
  CardColumns,
  Button,
} from "reactstrap";

function Post() {
  return (
    <div className="d-flex justify-content-center mt-5">
      <CardColumns>
        <Card className="mb-2" style={{ width: "900px", marginTop: "50px" }}>
          <div className="row">
            <div className="col-md-6">
              <CardImg className="postImg" alt="first Image"
                 src="https://picsum.photos/600/250"
                 style={{ width: "599px", height: "243px", borderRadius: "0px", bordertopleftradius: "50px" }}
              />
            </div>
            <div className="col-md-6">
              <CardImg className="scanerImg" alt="second Image" 
                 src="https://picsum.photos/400/250"
                 style={{ width: "298px", height: "243px", marginLeft: "138px", borderRadius: "px 0 0 0",}}
              />
            </div>
          </div>
          <CardBody>
            <CardTitle tag="h3">Event Title</CardTitle>
            <CardText>Description</CardText>
            <CardText><small className="text-muted">TimeStamp</small></CardText>
            <div className="d-flex justify-content-end">
              <Button color="primary">Update</Button>
              <Button color="danger" className="Button">Delete</Button>
            </div>
          </CardBody>
        </Card>
      </CardColumns>
    </div>
  );
}

export default Post;
